<div class="hatnote">A money making guide for [[Ironmen]] can be found [[Ironman Moneymaking Guide|here]].</div>

This is a list of some of the ways to make [[money]] (money makers) in ''[[Old School RuneScape]]'' and the requirements to do so. The prices and hourly rates are simply an estimate. The actual rates and profit are likely to differ. There are likely other ways that aren't included here; feel free to suggest them on the [[Talk:Money making guide|talk page]].

If you notice a discrepancy between profits listed here and profits listed on guide pages, it is probably because of a caching issue. You can clear the cache and force an update by clicking {{Purge|here|tag=span|noinplace=true}}.

'''Notes:'''
* '''{{Colour|red|Caution:}}''' You should always research the items and methods before trying these methods. Because of constantly changing prices of items, the estimated profit may be inaccurate.
* [[File:Clockwork_detail.png|x25px]] Any method in the "Hourly Profit" section that relies on buying an item from the [[Grand Exchange]] does not take into account the time needed to purchase the item or its [[buy limit]]. '''Therefore, do not assume the rate of item purchases on the GE matches the rate of item processing of the method.'''
* [[File:Grand Exchange logo.png|x25px]] All prices are calculated using current Grand Exchange [[market prices]], meaning the actual profit per hour may vary greatly from what is stated here. If you notice a discrepancy between profits listed here and profits listed on guide pages, it is likely a caching issue. You can force this page to update by clicking [[Special:Purge/{{FULLPAGENAME}}|here]].

__TOC__

==Hourly profit table==
'''Note:''' Most money making methods rely on [[Grand Exchange]] item prices '''WITHOUT''' the tax in place, which may fluctuate as players constantly sell for higher or lower than the listed price, and some items are less stable than others. For methods involving the processing of items, it is recommended to test each method with a small sample size before investing a lot of money, as the prices may not be fully accurate, possibly resulting in loss instead of profit.

{{MMG list}}

==Recurring methods==
Effective hourly profit is the amount of money you would make in an hour if you could continuously use these money makers. It is best not to use activities that have an effective profit less than what you can normally make otherwise.

Note that you can only do one type of [[herb]] [[farming]] at once, one type of [[brewing]] at once, and one of either picking [[papaya]]s or [[coconut]]s.
{{MMG recurring list}}

==Starting off==
{{Main|Stronghold of Security}}
[[File:Stronghold of Security map.png|thumb|A map of the Stronghold of Security.]]

[[Player]]s can visit the [[Stronghold of Security]] for some quick [[coins]]. Players can get {{Coins|10000}} just for completing the first three levels. This can be done even at [[Combat level]] 3, making it a good way to obtain your first bit of money.

==Miscellaneous methods==
===Merchanting===
{{main|Merchanting}}

[[Grand Exchange]] flipping, or merchanting, is the high-risk, high-reward activity of buying items for a low price and selling them at a higher price. You are looking for [[items]] that are unstable, but are frequently traded, with a changing price due to supply and demand.

===Untradeable supplies===
Certain money making methods use untradeable supplies that are gathered passively through normal gameplay, the time taken to gather these ingredients is impossible to objectively quantify with a specific value so they are assumed to be "zero time" to gather in these guides.
